import React from "react";
import QuizContainer from "./QuizContainer";

const Home = () => {
    

    return (
        <>
            <div className='relative flex flex-col text-center bg-[rgba(255,255,255,0.02)] z-0 h-full'>

                <div className='flex flex-col h-[90vh] justify-center items-center text-center p-10 '>
                    <p className='text-6xl font-bold'>Participer au jeu quiz <br /><span className='text-4xl font-light'>Femmes d'histoire</span></p>

                    <p className="text-xl">Explorez les histoires inspirantes des femmes qui ont marqué l'histoire, à travers un quiz captivant. Que vous cherchiez à apprendre ou à concourir pour un prix, commencez votre voyage ici :</p>
                </div>

                <div className="absolute bottom-4 left-4">
                    <p className='text-sm'>Les mentions légales</p>
                </div>

            </div>            
        </>
    );
};

export default Home;
